define({"topics" : [{"title":"Access the PBX via SSH","shortdesc":"\n                  <p class=\"shortdesc\">To debug the system, you can establish a temporary SSH connection on the PBX, and         access the PBX via SSH to check\n                     the logs.\n                  </p>\n               ","id":"task_ijw_jgg_4fb","href":"topic\/access_the_pbx_via_ssh_cloud.html","menu": {"hasChildren":false,},"tocID":"task_ijw_jgg_4fb-d46e17461","topics":[]},{"title":"Capture Ethernet Packets","shortdesc":"\n                  <p class=\"shortdesc\">When there is a problem on the VoIP extensions or trunks, you can use the Ethernet         Capture Tool to capture Ethernet\n                     packet, and download the packet to analyze it.\n                  </p>\n               ","id":"task_pnf_wsv_ydb","href":"topic\/capture_ethernet_packet.html","menu": {"hasChildren":false,},"tocID":"task_pnf_wsv_ydb-d46e17532","topics":[]},{"title":"Ping IP Address","shortdesc":"\n                  <p class=\"shortdesc\">A ping utility sends test messages from the local client to a remote target over the         TCP\/IP network connection. You\n                     can use IP Ping tool to test if the PBX can access the target         IP address.\n                  </p>\n               ","id":"task_xsk_lfw_ydb","href":"topic\/ping_ip_address.html","menu": {"hasChildren":false,},"tocID":"task_xsk_lfw_ydb-d46e17603","topics":[]},{"title":"Traceroute","shortdesc":"\n                  <p class=\"shortdesc\">Traceroute is a common diagnostic tool for displaying the route (path) and measuring         transit delays of packets across\n                     a network.\n                  </p>\n               ","id":"task_a1y_sjw_ydb","href":"topic\/trace_route.html","menu": {"hasChildren":false,},"tocID":"task_a1y_sjw_ydb-d46e17674","topics":[]}]});